import numpy as np
import pandas as pd

name = pd.Series(["신주용", "백승호", "김기찬", "김승원", "안지은"])
# 시리즈 생성
# 변수에 할당하기 전에 출력해서 확인하는 습관이 중요! -> 인터프리터의 장점을 극대화!

name

"""### DataFrame 생성"""

# 자료형, 클래스 -> 앞에 대문자
# 변수명, 함수명 -> 앞에 소문자
team = pd.DataFrame([["정봉균", "INFJ"], ["김민수", "ESFP"], ["최영화", "ENFP"], ["양하영", "ISFP"]], index = ["001", "002", "003", "004"], columns = ["이름", "MBTI"])
team

# 전치(Transpose) : 행과 열을 뒤집는 것
team = team.T

#값을 추가하거나 수정할 때의 방법
# 1. inplace 인자값으로 True 전달(ex. drop(inplace = True))
# 2. 새롭게 할당 (업데이트, 수정)

team

# 딕셔너리 DF 생성 -> 컬럼별로 추가! 리스트는 행으로 추가!
data = {"이름" : ["정봉균", "김민수", "최영화", "양하영"], "MBTI": ["INFJ", "ESFP", "ENFP", "ISFP"]}
team2 = pd.DataFrame(data, index = ["001", "002", "003", "004"])
team2

# 인덱스 확인
team2.index

# 컬럼명 확인
team2.columns

# 요소들 확인
team2.values
# 시리즈, 데이터프레임 -> ndarray로 구성되어 있음! -> NumPy 기능들을 같이 활용할 수 있음!(Pandas와 호환성이 뛰어남!)

# 모양 확인
team2.shape

